import React, { Component } from "react";
import Header from "../components/Header";
import { Link } from "react-router-dom";

const Map = () => (

  <div>
    <Header />
    <h1>Map</h1>
    <img src="../Image/campusmap.jpg" id="map"/>
  </div>
);

export default Map;
